import React from 'react'
import * as d3 from 'd3';

const Piechart = ({data, x, y}) => {
    var arrdata = [];
    const generateData = (data) => {
      data.forEach((d)=>{
        arrdata.push({
          "key" : d.key_as_string,
          "count" : d.group_by_Type.buckets.forEach((bucket)=>{
              bucket.total_count.value;
          })
        })
      })
    }
    generateData();
    return (
        // <g transform = {`translate{${x}, ${y}}`} />
        <div>
            {arrdata}
        </div>
    )
}

export default Piechart;
